from Crypto.Util.number import *
from gmpy2 import *
import uuid

flag = 'XSCTF{' + str(uuid.uuid4()) + '}'

p = getPrime(512)
q = getPrime(512)
n = p*q

p2 = pow(p,2,n)
q2 = pow(q,2,n)

e = 65537
c = pow(bytes_to_long(flag.encode()),e,n)

print('p2 =',p2)
print('q2 =',q2)
print('c =',c)

